import React from "react";

export default function photos(props) {
    if (props.photos) {
        return (
          <section className="Photos">
            <div className="row">
              {props.photos.map(function (photo, index) {
                return 
                <div className="col-4" key={index}><img src={photo.src.tiny} alt=" " />;</div>;
              })}
            </div>
          </section>
        );
    } else {
        return null;
    }
}
